import Login from "./components/Login";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Login />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
